import React from "react";
import { Container, Nav } from "react-bootstrap";
import Navbar from "react-bootstrap/Navbar";

export default () => {
  return (
    <Navbar bg="light">
      <Container>
        <Navbar.Brand href="/">Movies Now</Navbar.Brand>
        <Nav.Link href="/search">search</Nav.Link>
      </Container>
    </Navbar>
  );
};
